import React from 'react';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';

const NavbarItem = ({ children, className }) => (
  <div className={`px-4 py-2 cursor-pointer ${className}`}>{children}</div>
);

const App = () => {
  return (
    <div className="min-h-screen bg-gray-100 p-4">
      {/* Navbar Section */}
      <div className="flex justify-between items-center bg-white shadow-lg p-4 rounded-xl">
        <NavbarItem className="text-blue-500 font-semibold hover:text-blue-700">Home</NavbarItem>
        <NavbarItem className="text-gray-600 hover:text-gray-800">Explore</NavbarItem>
        <NavbarItem className="text-gray-600 hover:text-gray-800">Messages</NavbarItem>
        <NavbarItem className="text-gray-600 hover:text-gray-800">Profile</NavbarItem>
      </div>

      {/* Input and Upload Section */}
      <div className="mt-8 bg-white p-6 shadow-lg rounded-xl">
        <h2 className="text-xl font-semibold mb-4">Upload Your File</h2>
        <div className="flex items-center gap-4">
          <Input type="file" className="flex-1" />
          <Button className="bg-blue-500 text-white hover:bg-blue-600">Upload</Button>
        </div>
      </div>
    </div>
  );
};

export default App;
